require 'time'
# Given "pwwkew", the answer is "wke", with the length of 3. Note that
# the answer must be a substring, "pwke" is a subsequence and not a substring.
# Given a string, find the length of the longest substring without
# repeating characters.
# "abcabcbb"
# must be consecutive. put into hash when meets duplicate stops.
# increment to next character. when the max length is greater or equal to
# the rest of characters break the loop.
# store indices as value for characters (keys).

# run time: 3.736783
# exceding time limit
def max_length_slow s
  max_len = 0
  tmp_arr = []
  while (s.length) > max_len
     #str_arr.each do |x|
     for i in 0...s.length
      if !(tmp_arr.include? (s[i]))
        tmp_arr << s[i]
      else
      break
      end
    end
    max_len = (tmp_arr.length) if max_len < (tmp_arr.length)
    s = s[1..-1]
    tmp_arr.clear
  end
  max_len
end

#run time: 0.072969
def max_length_ok s
  n = s.length
  max_len = 0
  tmp_arr = []
  i = 0
  j = 0
  while i < n && j < n
    if !(tmp_arr.include? s[j])
      tmp_arr << s[j]
      j += 1
      max_len = ((max_len < (j-i)) ? (j-i) : max_len)
    else
      tmp_arr.shift
      i += 1
    end
  end
  max_len
end

# run time: 0.014209
# "tmmzuxt"
def max_length_fast s
  # pass -1 as param so that when item no exists in hash return default is -1.
  my_hs = Hash.new(-1)
  start = 0
  ans = 0
  # each-with_index equavalent to for loop in java.
  s.chars.each_with_index do |c, idx|
    # if char c is not existed in my hash return -1 which is less than start.
    if my_hs[c] >= start
      # if c is found in the hash, increment to the next starting point of the substring.
      start = my_hs[c] + 1
    else
      # the idx will be incremented by each iteration.
      ans = [ans, (idx - start + 1)].max
    end
    my_hs[c] = idx
  end
  ans
end

